import { useState } from "react";

function CompAddProduct() {
  const { productName, setProductName } = useState("");
  const { productPrice, setProductPrice } = useState("");
  const { productDesc, setProductDesc } = useState("");

  return (
    <>
      <div className="row">
        <div className="col-3">
          <label htmlFor="pNameInput" className="form-label">
            Product Name
          </label>
          <input type="pNameInput" id="pNameInput" className="form-control" onChange={(evt) => setProductName(evt.currentTarget.value)} value={productName} />
        </div>
        <div className="col-3">
          <label htmlFor="pPriceInput" className="form-label">
            Product Price
          </label>
          <input type="pPriceInput" id="pPriceInput" className="form-control" />
        </div>
        <div className="col-3">
          <label htmlFor="pDescInput" className="form-label">
            Product Desc
          </label>
          <input type="pDescInput" id="pDescInput" className="form-control" />
        </div>
        <div className="col-3"></div>
      </div>
    </>
  );
}

export default CompAddProduct;
